import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/Navbar/Navbar';
import Home from './pages/Home/Home';
import Login from './pages/Auth/Login';
import StudentRegister from './pages/Auth/StudentRegister';
import CoachRegister from './pages/Auth/CoachRegister';
import ProtectedRoute from './components/ProtectedRoute';
import Profile from './pages/Account/Profile';
import Registrations from './pages/Account/Registrations';
import Settings from './pages/Account/Settings';
import LiveMatches from './pages/LiveMatches/LiveMatches';
import './App.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Navbar />
          <Routes>
            {/* Redirect root path to login */}
            <Route path="/" element={<Navigate to="/login" replace />} />
            
            {/* Auth routes */}
            <Route path="/login" element={<Login />} />
            <Route path="/register/student" element={<StudentRegister />} />
            <Route path="/register/coach" element={<CoachRegister />} />
            
            {/* Protected routes */}
            <Route 
              path="/home" 
              element={
                <ProtectedRoute>
                  <Home />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/account/profile" 
              element={
                <ProtectedRoute>
                  <Profile />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/account/registrations" 
              element={
                <ProtectedRoute>
                  <Registrations />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/account/settings" 
              element={
                <ProtectedRoute>
                  <Settings />
                </ProtectedRoute>
              } 
            />
            <Route 
              path="/live-events" 
              element={
                <ProtectedRoute>
                  <LiveMatches />
                </ProtectedRoute>
              } 
            />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
